import React from "react";

function PopUp({ getPopUpData, apiDataP }) {
  return (
    <div className="overlay">
      <div className="popup"

      >
        <button className="close" onClick={(e) => getPopUpData(e)}>
          x
        </button>
        <img className="img content" src={apiDataP.urls.small} alt="img"></img>
        <div className="popup-contents">
            <div>
            <img className="" src={apiDataP.user.profile_image.medium} alt="img"></img>
            </div>
            <div>
            {apiDataP.user.name} {"  "}
            @{apiDataP.user.username}
            </div>
            <div>
            {apiDataP.instagram_username}
            </div>
            <div>
            {apiDataP.twitter_username}
            </div>
            <div></div>
            <div></div>
            <div>
            {apiDataP.likes}
            </div>
            <div></div>
        </div>  
      </div>
    </div>
  );
}

export default PopUp;
